"""Gli elementi sono ordinati in base ad un indice proprio di ciascuna Lista, ciò significa che a ciascun elemento è associato un numero che ne rappresenta la posizione nell'elenco: comprenderlo è fondamentale, perché se vogliamo accedere ad un elemento specifico avremo bisogno dell'indice corrispondente nella lista.

*NOTA FONDAMENTALE: le liste iniziano ad indice 0 quindi il primo indice delle liste è 0.*

"""

#creo una lista "mista" con elementi float, stringa e interi
lista=[9.81, "pasta", 22, 44, 3.14]
lista[1] # Per richiamare "pasta" dovremo quindi usare l'indice 1

"""Le liste supportano anche funzioni e metodi: len() per contare gli elementi, min() e max() per trovare l'elemento più piccolo/grande (a patto che i tipi degli elementi siano comparabili), .index() per trovare l'indice di un elemento, e .count() per contare quante volte un elemento è presente nella lista:"""

#creo la mia lista di caratteri
