"""Per lavorare con le liste di Python usiamo alcune specifiche istruzioni e alcuni metodi, che vengono richiamati su dati di un certo tipo. Tipi di dato diversi avranno a disposizione metodi diversi.

Aggiungere elementi con append() ed extend()

Volendo aggiungere singoli elementi ad una lista usiamo il metodo append():
"""

#creo la mia lista
lista_materie=["italiano","matematica"]
lista_materie.append("inglese") # aggiunge inglese alla fine
print(lista_materie)

"""Mentre per aggiungere elementi ad una lista da una seconda lista usiamo il metodo extend():"""

#creo la mia lista
lista_materie=["italiano","matematica"]
#creo la seconda lista che poi voglio inserire nella prima
lista_materie_extra=["meccanica", "informatica"]
lista_materie.extend(lista_materie_extra)
print(lista_materie)

"""Atri metodi sono:
- lista.insert(indice, elem): aggiunge elementi alla lista in posizione indice;
"""

#creo la mia lista
lista_materie=["italiano","matematica"]
lista_materie.insert(0,"spagnolo") #inserisco all'inizio (quindi in posizione 0) la stringa "spagnolo"
print(lista_materie)

"""- lista.pop(): rimuove e restituisce l'ultimo elemento della lista;"""

#creo la mia lista
lista_numeri=[1,2,3,4,5,6]
lista_numeri.pop() #rimuovo l'ultimo elemento della lista e me lo ristituisce in output

#se rendo visibile la riga sotto otterrò in output la lista senza l'ultimo elemento
#print(lista_numeri) # mi stampa la lista dei numeri senza l'ultimo

"""- lista.remove(elem): trova e rimuove l'elemento dalla lista;"""

#creo la mia lista
lista_numeri=[1,2,3,4,5,6]
lista_numeri.remove(2) # mi rimuove l'elemento 2
print(lista_numeri)

"""- lista.sort(): ordina gli elementi della lista dal più piccolo al più grande;"""

#creo la lista di char
